import * as React from "react";
import { styled, useTheme } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Drawer from "@mui/material/Drawer";
import CssBaseline from "@mui/material/CssBaseline";
import MuiAppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import ChevronRightIcon from "@mui/icons-material/ChevronRight";
import ClearIcon from "@mui/icons-material/Clear";
import { Link } from "react-router-dom";

import { motion } from "framer-motion";

const drawerWidth = 250;

const AppBar = styled(MuiAppBar, {
  shouldForwardProp: (prop) => prop !== "open",
})(({ theme, open }) => ({
  transition: theme.transitions.create(["margin", "width"], {
    easing: theme.transitions.easing.sharp,
    duration: theme.transitions.duration.leavingScreen,
  }),
  ...(open && {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: `${drawerWidth}px`,
    transition: theme.transitions.create(["margin", "width"], {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
  }),
}));

const DrawerHeader = styled("div")(({ theme }) => ({
  display: "flex",
  alignItems: "center",
  padding: theme.spacing(0, 1),
  ...theme.mixins.toolbar,
  justifyContent: "flex-end",
}));

export default function PersistentDrawerLeft() {
  const theme = useTheme();
  const [open, setOpen] = React.useState(false);

  const handleDrawerOpen = () => {
    setOpen(true);
  };

  const handleDrawerClose = () => {
    setOpen(false);
  };

  return (
    <Box sx={{ display: "flex", background: "red" }}>
      <CssBaseline />
      <AppBar
        position="fixed"
        open={open}
        style={{
          backgroundColor: "whitesmoke",
          width: "0%",
          position: "absolute",
          left: 0,
          top: 5,
        }}
      >
        <Toolbar>
          <IconButton
            color="orangered"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            edge="start"
            sx={{ mr: 2, ...(open && { display: "none" }) }}
          >
            <MenuIcon style={{ color: "orangered", marginTop: -7 }} />
          </IconButton>
        </Toolbar>
      </AppBar>
      <Drawer
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          "& .MuiDrawer-paper": {
            width: drawerWidth,
            boxSizing: "border-box",
            backgroundColor: "#B2C8BA",
          },
        }}
        variant="persistent"
        anchor="left"
        open={open}
      >
        <DrawerHeader style={{ borderBottom: "2px solid white" }}>
          <h2 style={{ marginRight: 30 }}>Drawer</h2>
          <IconButton style={{ color: "white" }} onClick={handleDrawerClose}>
            {theme.direction === "ltr" ? <ClearIcon /> : <ChevronRightIcon />}
          </IconButton>
        </DrawerHeader>
        <div
          style={{
            height: "100vh",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <div
            style={{
              flex: 5,
              width: "100%",
              height: "100%",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
              justifyContent: "center",
              gap: 20,
            }}
          >
            <motion.button
              onClick={handleDrawerClose}
              style={{
                width: "80%",
                height: 40,
                borderRadius: 5,
                backgroundColor: "#4CAF50",
                border: "none",
                fontSize: 14,
              }}
              whileHover={{
                backgroundColor: "lightblue",
                scale: 1.1,
                boxShadow: "40px 40px 0px 0px gray inset",
              }}
            >
              <Link
                style={{
                  textDecoration: "none",
                  color: "white",
                  fontWeight: "bolder",
                }}
                to="/"
              >
                HOME
              </Link>
            </motion.button>
            <motion.button
              onClick={handleDrawerClose}
              style={{
                width: "80%",
                height: 40,
                borderRadius: 5,
                backgroundColor: "#4CAF50",
                border: "none",
                fontSize: 16,
              }}
              whileHover={{
                backgroundColor: "lightblue",
                scale: 1.1,
                boxShadow: "40px 40px 0px 0px gray inset",
              }}
            >
              <Link
                style={{
                  textDecoration: "none",
                  color: "white",
                  fontWeight: "bolder",
                }}
                to="/skill"
              >
                SKILL
              </Link>
            </motion.button>
            <motion.button
              onClick={handleDrawerClose}
              style={{
                width: "80%",
                height: 40,
                borderRadius: 5,
                fontSize: 14,
                border: "none",
                backgroundColor: "#4CAF50",
              }}
              whileHover={{
                backgroundColor: "lightblue",
                scale: 1.1,
                boxShadow: "40px 40px 0px 0px gray inset",
              }}
            >
              <Link
                style={{
                  textDecoration: "none",
                  color: "white",
                  fontWeight: "bolder",
                }}
                to="/education"
              >
                EDUCATION
              </Link>
            </motion.button>
            <motion.button
              onClick={handleDrawerClose}
              style={{
                width: "80%",
                height: 40,
                border: "none",
                borderRadius: 5,
                backgroundColor: "#4CAF50",
              }}
              whileHover={{
                backgroundColor: "lightblue",
                scale: 1.1,
                boxShadow: "40px 40px 0px 0px gray inset",
              }}
            >
              <Link
                style={{
                  textDecoration: "none",
                  color: "white",
                  fontWeight: "bolder",
                }}
                to="/contact"
              >
                CONTACT
              </Link>
            </motion.button>
          </div>
          <div style={{ flex: 5 }}></div>
        </div>
      </Drawer>
    </Box>
  );
}
